import { Link, BrowserRouter, Router } from "react-router-dom";
function App() {
	return (
		<BrowserRouter>
			<div>
				<h1>Bievenido a Preguntados</h1>
				<Link to="/">Ir a las preguntas</Link>
			</div>

		</BrowserRouter>
	);
}

export default App;
